import * as Yup from 'yup';

class CountryModel {

	/**
	 * Model properties
	 */
	constructor() {
		this.countryName = '';
		this.countryNameBn = '';
		this.countryIdLegacy = '';
	}

	/**
	 * Get model instance from json
	 */
	fromJson(data = {}) {
		let obj = new CountryModel();
		if (data.id !== undefined && data.id) {
			obj.id = data.id;
		}
		obj.countryName = data.countryName ?? '';
		obj.countryNameBn = data.countryNameBn ?? '';
		obj.countryIdLegacy = data.countryIdLegacy ?? '';
		return obj;
	}

	/**
	 * Get string from model instance
	 */
	toString(data = {}) {
		let obj = new CountryModel()
			.fromJson(data);
		return JSON.stringify(obj);
	}

	/**
	 * Validator schema
	 */
	validator() {
		return Yup.object().shape({
			countryName: Yup.string()
				.min(3, 'Too Short!')
				.max(50, 'Too Long!')
				.required('Required'),
			countryNameBn: Yup.string()
				.min(3, 'Too Short!')
				.max(50, 'Too Long!')
				.required('Required')
		});
	}

}

export const Country = new CountryModel();
